import { css, keyframes } from 'emotion'


const Moody_text = () => {
    return (
        <div className={styles.title_holder}>
            <h1 className={styles.title}>Moody - NLP sentiment analysis</h1>
            <h3></h3>
        </div>
    )
}

const styles = {
    title_holder: css` 
        width: 100%;
        height: 180px;
        background-color: black;
        color: white;
        text-align: center;
        `,
        title: css`
        float: left;
        margin-top: 35px;
        margin-left: 5%;
        font-family:  Montserrat,-apple-system,BlinkMacSystemFont,Segoe UI,Fira Sans,Helvetica Neue,Arial,sans-serif;
        font-weight: 800;
        font-size: 35px;
        `
}

export default Moody_text;
